import React, { Component } from 'react'
import Table from '../table'
import { url } from '../../config.js'

export default class Home extends Component {
    state = {
        data: []
    };

    componentDidMount() {
        /*
        fetch(url + 'attendance/getRecent/30')
            .then(response => {
                return response.json();
            })
            .then(json => {
                this.setState({
                    data: json
                })
            })
            */
        this.setState({
            data: [
                {
                    instructor: 'Micheal Owen',
                    date: '2019-04-01',
                    subject: 'Math',
                    class: '073BCT'
                },
                {
                    instructor: 'Gary Owen',
                    date: '2019-04-01',
                    subject: 'Math',
                    class: '073BCT'
                }, {
                    instructor: 'Micheal Ballack',
                    date: '2019-04-01',
                    subject: 'Math',
                    class: '073BCT'
                }, {
                    instructor: 'John Terry',
                    date: '2019-04-01',
                    subject: 'Math',
                    class: '073BCT'
                }, {
                    instructor: 'Frank Lampard',
                    date: '2019-04-01',
                    subject: 'Math',
                    class: '073BCT'
                },
            ]
        })
    }
    render() {
        return (
            <div style={bodyStyle}>
                <Table data={this.state.data} onClickRow={(index) => this.props.onClickRow(this.state.data[index])} />
            </div>
        )
    }
}

const bodyStyle = {
}
